import styles from "./Register.module.css";
import { Link } from "react-router-dom";
import { useState } from "react";
import Navbar from "../../components/Navbar/Navbar";
import logoAdd from "../../assets/icons/person_add_black_24dp (1).svg";
import logoReset from "../../assets/icons/baseline-refresh-24px.svg";
import logoSave from "../../assets/icons/baseline-save-24px.svg";
import { ToastContainer, toast } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";
import InputMask from "react-input-mask";

const Register = () => {
  const [user, setUser] = useState("");
  const [name, setName] = useState("");
  const [company, setCompany] = useState("");
  const [cnpj, setCnpj] = useState("");

  const handleNameChange = (e) => {
    const inputValue = e.target.value;

    // Utilize uma expressão regular para permitir apenas letras e pontos
    const filteredValue = inputValue.replace(/[^a-zA-Z.]/g, "");

    setName(filteredValue);
  };

  const handleRegister = async () => {
    try {
      const response = await fetch("http://localhost:3000/register", {
        method: "POST",
        credentials: "include",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({
          user,
          name,
          company,
          cnpj,
        }),
      });

      if (
        user.user == null ||
        user.user == "" ||
        user.name == null ||
        user.name == "" ||
        user.company == null ||
        user.company == "" ||
        user.cnpj == "" ||
        user.cnpj == null
      ) {
        toast.error("Há campos não preenchidos!!");
      }

      if (response.ok) {
        console.log(response);
        toast.success("Usuário registrado com sucesso!");
        setName("");
        setUser("");
        setCompany("");
        setCnpj("");
      }
    } catch (error) {
      console.error("Erro ao registrar usuário:", error.message);
    }
  };

  return (
    <div className={styles.container}>
      <ToastContainer />
      <Navbar />
      <div className={styles.infoRectangle}>
        <h1 className={styles.titleAdd}>
          <img src={logoAdd} alt="logoAdd" className={styles.logoAdd} />
          CADASTRAR UM NOVO USUÁRIO
        </h1>
        <div className={styles.containerInput}>
          <div>
            <label>USUÁRIO</label>
            <input
              type="text"
              className={styles.inputStyles}
              value={user}
              onChange={(e) => setUser(e.target.value)}
              maxLength={30}
            />
          </div>
          <div>
            <label>NOME</label>
            <input
              type="text"
              className={styles.inputStyles}
              value={name}
              onChange={((e) => setName(e.target.value), handleNameChange)}
              maxLength={35}
            />
          </div>
          <div>
            <label>EMPRESA</label>
            <input
              type="text"
              className={styles.inputStyles}
              value={company}
              onChange={(e) => setCompany(e.target.value)}
              maxLength={35}
            />
          </div>
          <div>
            <label>CNPJ</label>
            <InputMask
              mask="99.999.999/9999-99"
              type="text"
              className={styles.inputStyles}
              value={cnpj}
              onChange={(e) => setCnpj(e.target.value)}
            />
          </div>
        </div>
      </div>
      <div className={styles.containerRemove}>
        <div className={styles.quadradoCinza}>
          <img
            className={styles.logoRemove}
            src={logoReset}
            alt="ImagLogoRemove"
          />
        </div>
        <Link className={styles.linkRetangularCinza} to="/register">
          RESETAR SENHA
        </Link>
      </div>
      <div className={styles.containerAdd}>
        <div className={styles.quadradoAzul}>
          <img className={styles.logoCad} src={logoSave} alt="ImagLogoAddem" />
        </div>
        <button className={styles.linkRetangular} onClick={handleRegister}>
          SALVAR ALTERAÇÕES
        </button>
      </div>
    </div>
  );
};

export default Register;
